pragma solidity ^0.8.0;

library Marketplace {
    event OfferingPlaced(bytes32 indexed offeringId, address indexed hostContract, address indexed offerer, uint tokenId, uint price);
    event OfferingClosed(bytes32 indexed offeringId, address indexed buyer);
    event BalanceWithdrawn (address indexed beneficiary, uint amount);
    event OperatorChanged (address previousOperator, address newOperator);
    event ParameterControlChanged (address previousOperator, address newOperator);
    event ApprovalForAll(address owner, address operator, bool approved);

    struct Benefit {
        uint256 benefitPercentCreator;
        uint256 benefitCreator;
        uint256 benefitPercentOperator;
        uint256 benefitOperator;
        uint256 discountRoveToken;
    }

    struct Offering {
        address offerer;
        address hostContract;
        uint tokenId;
        uint price;
        bool closed;
        address erc20Token;
    }

    struct CloseOfferingData {
        address buyer;
        uint price;
        uint originPrice;
        uint256 balanceBuyer;
        uint256 approvalToken;
        address erc20Token;
    }
}

contracts/services/SimpleMarketplaceServ.content:
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/StringsUpgradeable.sol";

import "../libs/helpers/Errors.sol";
import "../libs/structs/Marketplace.sol";
import "../governance/ParameterControl.sol";

contract SimpleMarketplaceService is Initializable, ReentrancyGuardUpgradeable {
    using CountersUpgradeable for CountersUpgradeable.Counter;
    CountersUpgradeable.Counter private _offeringNonces;


    address public _admin; // is a mutil sig address when deploy
    address public _parameterAddr;

    mapping(bytes32 => Marketplace.Offering) public _offeringRegistry;
    bytes32[] public _arrayOffering;


    function initialize(address admin, address parameterControl) initializer public {
        require(admin != Errors.ZERO_ADDR, Errors.INV_ADD);
        require(parameterControl != Errors.ZERO_ADDR, Errors.INV_ADD);

        _admin = admin;
        _parameterAddr = parameterControl;
    }

    function changeAdmin(address newAdm) external {
        require(msg.sender == _admin && newAdm != Errors.ZERO_ADDR, Errors.ONLY_ADMIN_ALLOWED);

        // change admin
        if (_admin != newAdm) {
            address _previousAdmin = _admin;
            _admin = newAdm;
        }
    }

    function changeParamAddr(address newAddr) external {
        require(msg.sender == _admin && newAddr != Errors.ZERO_ADDR, Errors.ONLY_ADMIN_ALLOWED);

        // change
        if (_parameterAddr != newAddr) {
            _parameterAddr = newAddr;
        }
    }

    function arrayOffering() external view returns (bytes32[] memory) {
        return _arrayOffering;
    }

    // NFTs's owner place offering
    function placeOffering(address _hostContract, uint _tokenId, address _erc20Token, uint _price, bool _withdrawImm) external nonReentrant returns (bytes32) {
        // owner nft is sender
        address nftOwner = msg.sender;

        // get hostContract of erc-721
        ERC721Upgradeable hostContract = ERC721Upgradeable(_hostContract);
        require(hostContract.ownerOf(_tokenId) == nftOwner, "INVALID_ERC721_OWNER");
        // check approval of erc-721 on this contract
        bool approval = hostContract.isApprovedForAll(nftOwner, address(this));
        require(approval == true, "ERC-721_NOT_APPROVED");

        // create offering nonce by counter
        _offeringNonces.increment();
        uint256 newItemId = _offeringNonces.current();

        // init offering id
        bytes32 offeringId = keccak256(abi.encodePacked(newItemId, _hostContract, _tokenId));
        // create offering by id
        _offeringRegistry[offeringId].offerer = nftOwner;
        _offeringRegistry[offeringId].hostContract = _hostContract;
        _offeringRegistry[offeringId].tokenId = _tokenId;
        _offeringRegistry[offeringId].price = _price;
        if (_erc20Token != address(0x0)) {
            _offeringRegistry[offeringId].erc20Token = _erc20Token;
        } else {
            _offeringRegistry[offeringId].erc20Token = address(0x0);
        }

        _arrayOffering.push(offeringId);
        emit Marketplace.OfferingPlaced(offeringId, _hostContract, nftOwner, _tokenId, _price);
        return offeringId;
    }

    function closeOffering(bytes32 _offeringId) external nonReentrant payable {
        // get offer
        Marketplace.Offering memory _offer = _offeringRegistry[_offeringId];
        address hostContractOffering = _offer.hostContract;
        ERC721Upgradeable hostContract = ERC721Upgradeable(hostContractOffering);
        uint tokenID = _offer.tokenId;
        address offerer = _offer.offerer;
        bool isERC20 = _offer.erc20Token != address(0x0);

        // buyer is sender
        Marketplace.CloseOfferingData memory _closeOfferingData;
        ERC20Upgradeable token;
        if (isERC20) {
            token = ERC20Upgradeable(_offer.erc20Token);
            _closeOfferingData = Marketplace.CloseOfferingData(
                msg.sender,
                _offer.price,
                _offer.price,
                token.balanceOf(msg.sender),
                token.allowance(msg.sender, address(this)),
                _offer.erc20Token
            );
        } else {
            _closeOfferingData = Marketplace.CloseOfferingData(
                msg.sender,
                _offer.price,
                _offer.price,
                0,
                0,
                address(0x0) // is ETH
            );
        }

        // check require
        require(hostContract.ownerOf(tokenID) == offerer, "INVALID_ERC721_OWNER");
        if (isERC20) {
            // check approval of erc-20 on this contract
            require(_closeOfferingData.approvalToken >= _closeOfferingData.price, "ERC-20_NOT_APPROVED");
            require(_closeOfferingData.balanceBuyer >= _closeOfferingData.price, "ERC-20_BALANCE_INVALID");
        } else {
            require(msg.value >= _closeOfferingData.price, "VALUE_INVALID");
        }
        require(!_offeringRegistry[_offeringId].closed, "OFFERING_CLOSED");

        // transfer erc-721
        hostContract.safeTransferFrom(offerer, _closeOfferingData.buyer, tokenID);

        // logic for 
        // benefit of operator here
        ParameterControl parameterController = ParameterControl(_parameterAddr);
        Marketplace.Benefit memory _benefit = Marketplace.Benefit(0, 0, 0, 0, 0);
        _benefit.benefitPercentOperator = parameterController.getUInt256("MARKET_BENEFIT");
        if (_benefit.benefitPercentOperator > 0) {
            _benefit.benefitOperator = _closeOfferingData.originPrice * _benefit.benefitPercentOperator / 10000;
            _closeOfferingData.price -= _benefit.benefitOperator;
            // update balance(on market) of operator
            //            _balances[_admin][_closeOfferingData.erc20Token] += _benefit.benefitOperator;
        }

        if (isERC20) {
            bool success = token.transferFrom(_closeOfferingData.buyer, address(this), _closeOfferingData.originPrice);
            require(success == true, "TRANSFER_FAIL_E1");
            success = token.transferFrom(address(this), _offer.offerer, _closeOfferingData.price);
            require(success == true, "TRANSFER_FAIL_E2");
        } else {
            require(address(this).balance > 0, "INVALID_FUND");
            (bool success,) = _offer.offerer.call{value : _closeOfferingData.price}("");
            require(success, "TRANSFER_FAIL_N");
        }
        // close offering
        _offeringRegistry[_offeringId].closed = true;

        emit Marketplace.OfferingClosed(_offeringId, _closeOfferingData.buyer);
    }
}

